import { Link } from 'react-router-dom';


const Navbar = () => {
    return (
        <nav className="navbar">
            <h2>BookMarker</h2>
            <div className="container">
                <ul>
                    <li><Link to="/"></Link>Home</li>
                    <li><Link to="/search" ></Link>Search</li>
                    <li><Link to="/saved" ></Link>Save</li>
                </ul>
           </div> 
        </nav>
      );
}

export default Navbar;
